description:
This is a rare and fine Spanish compilation of some of the best material Lou Reed had to offer. It is from the year 1999. As far as I'm aware, this double CD set was exclusive of Spain, and was never released abroad. It is perhaps the best &quot;Greatest Hits&quot; album about Lou Reed that I know of. It has been out of print for some years now, so go ahead and enjoy it.


From Discogs:

&quot;&quot;For the first time in CD or album, the &quot;Charley's Girl&quot; contained in this compilation is the 7&quot; mix/version, slightly different from that on the &quot;Coney Island Baby&quot; album. &quot;&quot;Sally Can't Dance&quot; is also the 7&quot; version. &quot;Leave Me Alone&quot; is the early version contained in the &quot;Between Thought And Expression&quot; Box, and &quot;The Bells&quot; is the edited version also contained in the same box.&quot;&quot;
